import { CalendarComponent } from "@syncfusion/ej2/-react-calendars";

const HomePage = () => {
  const dateValue: Date = new Date(
    new Date.getFullYear(),
    new Date().getMonth(),
    20
  );
  return (
    <div>
      <CalendarComponent>value = dateValue</CalendarComponent>
    </div>
  );
};

export default HomePage;
